import React, {Component} from "react";
import Home from "./home";


class App extends Component {
    state = {
        toggleAdmin: true,
    };

    render() {
        return (
            <React.Fragment>
            {!this.state.toggleAdmin && <Home/>}

            </React.Fragment>
        );
    }
}

export default App;
